import FileUploadOutlined from "@mui/icons-material/FileUploadOutlined";
import TextField from "@mui/material/TextField";

<TextField
      variant="standard"          
      type="text"
      InputProps={{
        endAdornment: (
          <IconButton component="label">
            <FileUploadOutlined />
            <input
              styles={{display:"none"}}
              type="file"
              hidden
              onChange={handleUpload}
              name="[licenseFile]"
            />
          </IconButton>
        ),
      }}
    />
